import './InputButton.css';

const InputButton: React.FC<InputButtonProps> = (props) => <div className='input-button' onClick={() => props.onClick(props.value)} >
    {props.text}
</div>

interface InputButtonProps {
    text: string;
    value: string;
    color: string;
    order: number;
    onClick: (value: string) => void;
}

export default InputButton;
